INSERT INTO `terminos_condiciones` (`id`, `titulo`, `descripcion`, `id_hotel`, `id_autor`, `fecha_crea`, `activo`) VALUES
(1, 'TÉRMINOS Y CONDICIONES', 'TÉRMINOS Y CONDICIONES\n 1. NÚMERO DE OCUPANTES: La Habitación salvo acuerdo expreso, sólo podrá ser utilizado por el número de personas indicado en la\nconfirmación de la reserva. Este no podrá exceder del número asignado y previsto para cada habitación\n2. REQUISITOS DE IDENTIFICACIÓN: El contratante deberá enviarnos todos (incluyendo niños) los nombres de las personas que se\nalojaran en nuestros hoteles con su respectivo documento de Identidad vigente que puede ser Cédula de Ciudadanía\nColombiana, Cédula de Extranjería o Pasaporte vigentes\n3. PRECIOS: Los precios de las Habitaciones dependen del número de personas. La estancia mínima es de 3 noches, exceptuando fechas\nespeciales en que esa estancia mínima se puede incrementar. VALORES SUJETOS A TEMPORADA.\n4. FORMA DE PAGO: Para realizar su reserva se exigirá el 100% del total, deberá ser pagado en su totalidad en efectivo o con tarjeta de\ncrédito. Tenga en cuenta que, en caso de confirmarle disponibilidad, para garantizar su reserva, deberá efectuar el pago inmediato en\nefectivo o consignando en nuestra Cuenta Bancaria; TODOS LOS GASTOS GENERADOS POR TRANSFERENCIAS BANCARIAS SERÁN\nASUMIDOS POR EL CONTRATANTE.\n5. CHECK IN: A PARTIR DE LAS 3 P.M. O ANTES DEPENDIENDO DE LA DISPONIBILIDAD DE LA HABTACION\n6. CHECK OUT: DEBERÁ REALIZARSE ANTES DE LA 1:00 P.M. DE LO CONTRARIO SE GENERARÁ UNA NOCHE MÁS CON COSTO ADICIONAL.\nSOLICITAMOS A NUESTROS HUÉSPEDES HACER ENTREGA LA HABITACION EN LAS MISMAS CONDICIONES EN QUE FUE RECIBIDO Y\nRECOMENDAMOS EL BUEN USO DE TODOS LOS IMPLEMENTOS QUE EN ELLA ENCUENTRE.\n7. DAÑOS: Deberán ser informados y pagados antes de abandonar el inmueble.\n8. CANCELACIÓN DE RESERVAS: Para CANCELAR una reserva aplica una penalización la cual será equivalente al valor de una noche de\nestancia en el inmueble; para cualquier tipo de cancelación se solicita avisar con un mínimo de 7 días, el resto del depósito quedara\npara una próxima reserva. Si cancela su reserva en menos del tiempo establecido deberá pagara un recargo adicional. 9. CAMBIO DE FECHA EN SU RESERVA: Todas nuestras habitaciones están sujeto a disponibilidad; Puede que la habitación que usted haya\nreservado anteriormente no esté disponible para la nueva fecha, de ser así; será cambiado para una habitación con las mismas\ncondiciones del requerido anteriormente. El cambio de fecha en la reserva podría acarrear un recargo, dependiendo de la temporada.\n10. ESTADÍAS LARGAS: Tarifas preferenciales con descuento cuando su estadía sea superior a los 15 días o el mes.\n11. NORMAS DE CONVIVENCIA: Solicitamos respetar y acatar las normas de convivencia del hotel, para preservar el buen ambiente que\nusted y todos los demás residentes se merecen\n12. De acuerdo A lo dispuesto en el artículo 17 de la ley 679 de 2001 y la resolución 3840 de 2009; Se rechaza todas las formas de\nexplotación, pornografía, violencia, turismo sexual y demás formas del abuso a menores de edad.\n13. EL TITULAR DE LA RESERVA DE INFORMAR A TODOS SUS ACOMPAÑANTES SOBRE LOS TÉRMINOS ANTERIORMENTE MENCIONADOS.\n14. El hecho de haber realizado una reserva implica la aceptación de los términos condiciones del servicio.', 1, 1, '2021-08-31 03:50:11', 1),
(2, '', 'Duración del alquiler: \nde 9am a 6pm \n\nTERMINOS Y CONDICIONES \n1- Se debe tener licencia de conducir a la mano físico.\n2- La gasolina corre por cuenta del visitante, se gastan 20 mil pesos en todo el día de uso del carrito. \n3- Se debe realizar un deposito de 50 mil pesos como seguro que la mulita se recibe a la hora pactada y con la gasolina que usted la recibe.\n', NULL, 3, '2021-11-22 20:40:38', 1);
